import React from "react";

import classes from "./FollowingsSection.module.css";
import userImg from "../../images/Photo.png";

const FollowingsSection = () => {
  return (
    <section>
      <div className={classes.section__wrapper}>
        <h2 className={classes.section__header}>My followings</h2>
        <ul className={classes.followings}>
          <TwitterAccount />
        </ul>
        <div className={classes.add__followings}>
          <input
            type="text"
            className={classes.twitterHandler__input}
            placeholder="@twitterhandle"
          />
          <button className={classes.btn__add}>Add</button>
        </div>
      </div>
    </section>
  );
};

export default FollowingsSection;
